import { Container, withStyles, Typography } from "@material-ui/core";


export const SectionContainer = withStyles({
        root: {
            paddingTop: "32px",
            paddingBottom: "32px"
        },
      })(Container);


export const TopSectionContainer = withStyles({
        root: {
            backgroundImage: "url(/img/header_club_green.png)",
            paddingTop: "32px",
            paddingBottom: "32px",
            textAlign: 'center'
        },
      })(Container);

export const SectionHeader = withStyles({
    root: {
        color: 'gray',
        width: '100%',
        fontSize: '20px',
        paddingTop: "8px",
        paddingBottom: "16px",
        textAlign: 'center'
    },
  })(Typography);
